"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"UTD.htm?25/37/26194?source=see_link\">",
"      Patient information: Bulimia nervosa (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"UTD.htm?8/45/8914?source=see_link\">",
"      Patient information: Post-traumatic stress disorder (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"UTD.htm?32/30/33249?source=see_link\">",
"      Patient information: Antisocial personality disorder (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"UTD.htm?11/18/11554?source=see_link\">",
"      Patient information: When you have depression and another health problem (The Basics)",
"     </a>",
"    </p>",
"    <p class=\"headingAnchor2\" id=\"H6663250\">",
"     <span class=\"h3\">",
"      Beyond the Basics",
"     </span>",
"     &nbsp;&mdash;&nbsp;Beyond the Basics patient education pieces are longer, more sophisticated, and more detailed. These articles are best for patients who want in-depth information and are comfortable with some medical jargon.",
"    </p>",
"    <p>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?28/21/29013?source=see_link\">",
