"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?19/41/20116?source=see_link\">",
"      Patient information: Depression in adults (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?21/24/21894?source=see_link\">",
"      Patient information: Depression treatment options for adults (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?14/54/15203?source=see_link\">",
"      Patient information: Hypothyroidism (underactive thyroid) (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?9/0/9220?source=see_link\">",
"      Patient information: Adrenal insufficiency (Addison's disease) (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?28/35/29238?source=see_link\">",
"      Patient information: Systemic lupus erythematosus (SLE) (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?38/55/39796?source=see_link\">",
"      Patient information: Bipolar disorder (manic depression) (Beyond the Basics)",
"     </a>",
"     <br/>",
"    </p>",
"    <p class=\"headingAnchor2\" id=\"H31\">",
"     <span class=\"h2\">",
"      Professional level information",
"     </span>",
"     &nbsp;&mdash;&nbsp;Professional level articles are designed to keep doctors and other health professionals up-to-date on the latest medical findings. These articles are thorough, long, and complex, and they contain multiple references to the research on which they are based. Professional level articles are best for people who are comfortable with a lot of medical terminology and who want to read the same materials their doctors are reading.",
"    </p>",
"    <p>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?5/10/5289?source=see_link\">",
"      Depression in adolescents: Epidemiology, clinical manifestations, and diagnosis",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?15/23/15736?source=see_link\">",
"      Effect of antidepressants on suicide risk in children and adolescents",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?23/17/23834?source=see_link\">",
