" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Congenital myopathies",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?13/6/13417/contributors\">",
