var title_f13_6_13418="Macula lutea with AMD";
var content_f13_6_13418=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F80193&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F80193&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 520px\">",
"   <div class=\"ttl\">",
"    Macula lutea and ocular structures with age-related macular degeneration (AMD)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 500px; height: 509px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     A)",
"    </strong>",
"    Fundus photograph of normal retina.The macula is the central part of the retina. The fovea is about the size of the optic nerve (diameter, 1500 micrometer) and is centered on the foveola. The foveola is the thinnest part of the retina. It&nbsp;is responsible for the most acute detailed vision.",
"    <strong>",
"     B)",
"    </strong>",
"    Cross section of normal retina, choroid, and sclera. A photon of light must penetrate all of the layers of the retina before being absorbed and converted into a neural signal by the photoreceptor outer segments.&nbsp;The retinal photoreceptors and retinal pigment epithelium (RPE) are metabolically active cells that depend on the choroidal vasculature to supply oxygen and nutrients and remove metabolic waste.",
"    <strong>",
"     C)",
"    </strong>",
"    <strong>",
"     Dry AMD or nonneovascular AMD",
"    </strong>",
"    is characterized by nodular, hard drusen (localized deposits of extracellular material), with sharp edges, diffuse soft drusen, and RPE hyperplasia and hyperpigmentation. The risk for progression to wet or neovascular AMD increases with increasing number and size of drusen and the presence of RPE pigmentary abnormalities.",
"    <strong>",
"     Wet AMD or neovascular AMD",
"    </strong>",
"    is characterized by the intrusion of abnormal new vessels from the choroid into the subretinal (type 2) or sub-RPE (type 1) space. In some cases, neovascularization may originate from the retinal vessels (not shown), with or without a choroidal component. Choroidal neovascularization often exudes fluid or hemorrhage into the subretinal or sub-RPE space.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Arroyo JG. A 76-Year Old Man With Macular Degeneration. JAMA 2006; 295:2394. Copyright &copy; 2006 American Medical Association. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
